import React from 'react'



function ViewFrom({ onClose }) {


    // button close
    const handleClose = () => {
        onClose();
    };

    return (
        <section>
            <header className='bg-white space-y-4 p-4 sm:px-8 lg:p-4'></header>
        </section>
    )
}

export default ViewFrom
